  false,\n\t\"url\": null,\n\t\"notes\": \"This narrative report for Lostwood National
  Wildlife Refuge outlines Refuge accomplishments from January through April of 1953.
  The report begins by summarizing the weather conditions, water conditions, and wildfires
  during this period. Wildlife- including migratory birds, upland game birds, big
  game animals, furbearers, predators, rodents, raptors, and fish- is also covered.
  The Refuge development and maintenance section discusses physical developments,
  plantings, and collections and receipts. Resource management is outlined; topics
  include grazing, haying, and fur trapping. A progress report on field investigations
  and applied research is also provided. The public relations section of the report
  describes Refuge visitors and Refuge participation. Items of interest are attached.\",\n\t\"license_title\":
